var title_f24_37_25173="Reconstruction with pedicled - attached - TRAM flap PI";
var content_f24_37_25173=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F79289&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F79289&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 578px\">",
"   <div class=\"ttl\">",
"    Reconstruction with pedicled (attached) TRAM flap",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 558px; height: 721px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Women who have reconstruction with a pedicled TRAM flap have a flap of tissue cut out of their belly. The flap is made up of skin, fat, and a chunk of muscle. When surgeons cut the flap, they free the muscle from the belly but they do not detach it completely. Instead, they leave the muscle attached at the top, by the chest. They create a tunnel between the belly and the chest and pull the flap up through that tunnel. Then they attach the flap to the chest, and it becomes the new breast. The flap still has blood coming to it, because it was never completely detached. Later, surgeons can also reconstruct a nipple. TRAM stands for \"transverse rectus abdominus myocutaneous.\"",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
