"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Uterine adenosarcoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 381px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This cellular stroma of this tumor forms hypercelluar cuffs surrounding the benign-appearing, mostly slit-like glands. Foci of squamous metaplasia are present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Silverberg SG, Kurman RJ. Tumors of the Uterine Corpus and Gestational Trophoblastic Disease. AFIP Atlas of Tumor Pathology, version 2.0, American Registry of Pathology, Washington DC, 1995.",
