" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Inflamed tophaceous gout",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 383px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Three inflamed tophi over the proximal interphalangeal joints in a patient with chronic tophaceous gout. Several of the lesions ruptured spontaneously over the next three days, exuding a pasty material composed of urate crystals and inflammatory cells but no organisms. The inflammation largely subsided over one week after the administration of a nonsteroidal antiinflammatory drug.",
"    <div class=\"footnotes\">",
